import React from 'react';

class Pokemon extends React.Component {

  render() {

    const { pokeData } = this.props;

    return (
     <div>

    pokeData.map((element) => {
      `Nome: ${element.name}`
      `Tipo: ${element.type}`
      `Peso médio: ${element.averageWeight}`
      `Foto: ${element.image}`
    })

     </div>
    )
  }
}

export default Pokemon;
